import { loginFailure, loginStart, loginSuccess } from "./UserRedux";
//import { publicRequest, userRequest } from "../requestMethods";
import axios from "axios";

export const login = async (dispatch, user) => {   //user=>{email:"abc",password:"***"}
    console.log(user)  // i got user=>{email:"abc",password:"***"}
  dispatch(loginStart());
  try {
    const res = await axios.post("http://localhost:2929/api/user/login",user)
    console.log(res) //await userRequest.post("user/login", user); //usingg axios
    dispatch(loginSuccess(res));
  } catch (err) {
    dispatch(loginFailure());
  }
};
